import { Button, Card, Container } from 'react-bootstrap';

function HomePage() {
  return (
    <Container>
      // eslint-disable-next-line jsx-a11y/alt-text
      <img src="../assets/rect_gradiant.svg" />
      <Card className="p-5 ml-2 mr-2 mt-5">
        <ol><Button variant="outline-primary" href="/">Home</Button></ol>
        <ol><Button variant="outline-primary" href="/pf">Portfolio</Button></ol>
        <ol><Button variant="outline-primary" href="/about-me">About Me</Button></ol>
      </Card>
    </Container>

  );
}

export default HomePage;
